INSERT INTO `checklist_items` (`idcheckList`, `checkpoint`) VALUES
(26, 'Guyed Pole is completely erected, no missing or loose members. Assembly is done according to manufacturer?s Design Drawings; Height : 15 m.'),
(27, 'Guyed Pole painted according to ICAO, where applicable.'),
(28, 'All wire tensioning meet requirement as specification recommendation or design (according to the design drawing).'),
(29, 'All bolts tightened to meet torque requirement as supplier?s recommendation (minimum requirement: spring washer has to be sufficient tightened to be flat, i.e. snug-tight).'),
(30, 'All bolts, nut, spring washer, plate washer is installed according to the specification and drawing'),
(31, 'No structural defects at Guyed Pole, no sever rust of bolts, no nonstandard welding (especially for co-located sites).'),
(32, 'Space between column surface and Lid Box grouted with non-shrinking grout.'),
(33, 'Base frame installation is constructed according to As Build Drawings.'),
(34, 'Equipment grounding cables are installed and connected to the main site grounding and suitable for connection according to drawings'),
(35, 'Grounding bus-bar(s) for feeder cable earth kits are installed at Guyed Mast / Poles'),
(36, 'Grounding bus-bar for feeder cable earth kits are installed near to the equipment'),
(37, 'All steel work (cable tray, ladder, lightning protection) grounding is installed correctly'),
(38, 'No concerns of over-load on Guyed Pole, i.e. too many antennas and microwaves, two or more cable ladders etc. Load-non-conformance to Guyed Mast or Pole name plate (especially for co-located sites).'),
(39, 'Antenna mounting poles are positioned correctly.'),
(40, 'Guyed Pole aircraft warning light(s) (OBL-light) is installed & functioning properly'),
(41, 'Access-ladder and handrails provided as needed and correct as per standard'),
(42, 'The site area is free of construction waste and excess material'),
(24, 'No structural defects at existing building (i.e. no crack at roof surface, no crack at beam, column)'),
(25, 'All of dimension of existing structure is according to As Build Drawing (i.e. space between column, dimension of column, dimension of beam)');
