INSERT INTO `deficiency_items` (`id_deficiency_tems`, `site_number`, `deficiency_items`) VALUES
(1, '090483B', 'Wire tensioning checked and found OK. The top section which is not adjustable, is seriously out of verticality spec (100mm). This cannot be adjusted as guy attachments are not fitted to top section'),
(2, '090483B', 'Loose Bolts have been tightened'),
(3, '090483B', 'Some of Bolts installed not correct according to the design drawing. Erectors have not sorted\r\nbolts according to the drawings'),
(4, '090483B', 'Some minor corrosion on Turnbuckles. Anchor Pivot Bolt Split Pins seriously corroded and\r\nneed replacement. Stainless Steel Jubilee Clips have been used to stop guy wire ends\r\nunravelling at bottom of Mast only, NOT at Mast attachment. These are corroded'),
(5, '090483B', 'Base frame dimension is NOT stated in As Build Drawing'),
(6, '090483B', 'Some of steel work grounding NOT installed properly'),
(7, '090483B', 'No Site ID Plate installed with Loading details, but loading shown on ''As-Planned'' Drawing'),
(8, '090483B', 'OBL is installed but NOT working. Technically the mast should be ICAO painted unless there\r\nis a local regulation otherwise, but other structures in the vicinity are ICAO painted'),
(9, '090066D', 'Wire tensioning checked and not to specification. Wire Tensioning is NOT stated in As Build Drawing'),
(10, '090066D', 'Some Bolts found to be loose and not corresponding to Design Drawing. Bolts tightened'),
(11, '090066D', 'Some Bolts, diameter is NOT according to design drawing e.g Anchor Pivot Bolt is M16, not M20. Some Bolts do not have Lock Nut fitted'),
(12, '090066D', 'Split Pins for the "Eye-Jaw" Turnbuckle to Equaliser Plat and Shackle to Pole are corroded'),
(13, '090066D', 'Base dimensions are NOT stated in As Build Drawing'),
(14, '090066D', 'Grounding installation is NOT properly installed'),
(15, '090066D', 'Grounding installation is NOT properly installed i.e Original 2G Cable Tray not fixed to roof. New 3G Cable Tray, joints do not have Bonding Straps'),
(16, '090066D', 'The OBL-light is installed but NOT working'),
(17, '090066D', 'Access-ladder and Handrails provided to access Masjid Roof, but top section is not fixed properly to the wall. Wooden Steps leading to Access Ladder broken and dangerous');
