INSERT INTO `other_comments` (`idcomments`, `site_number`, `comments`) VALUES
(1, '090483B', 'Base frame dimension is 4200 x 3500 mm'),
(2, '090483B', 'The top section of the Guyed Mast exceeds Verticality limit, probably due to bad\r\nmachining of the flanges or most of the Antenna loading is on one side. This cannot\r\nbe adjusted as the top section is not guyed'),
(3, '090483B', 'This is a counter weight site using concrete weights and there are no Anchor Bolts,\r\nBase Frame legs sit on Rubber Pads on top of a concrete Pad'),
(4, '090483B', 'Anti-Tamper Loops are not installed'),
(5, '090483B', 'All Guy wire ends need to be fitted with Crimp Cap or new Jubilee Clips to prevent\r\nunravelling'),
(6, '090483B', '''As-Build'' Drawings are ''As Planned'' Drawings and have not been updated'),
(7, '090483B', 'All Split Pins fitted to Turnbuckle Jaws need to be replaced'),
(8, '090483B', 'Turnbuckle Jaw Bolts have been installed in different directions. This is a major\r\nmaintenance item to correct'),
(9, '090483B', 'OBL Not working'),
(10, '090483B', 'Mast should be ICAO painted'),
(11, '090066D', 'This is a Guyed Pole structure is directly installed to the roof using Anchor Bolts and no Base Frame. Other Operators installations use ?Stealth Solution?'),
(12, '090066D', 'The Base dimension is 4200 x 4150 mm'),
(13, '090066D', 'The Anchor Pivot Bolts installed are M16x70, NOT M20x70'),
(14, '090066D', 'No Anti Tamper Loops have been installed to the Turnbuckles'),
(15, '090066D', 'Some Bolts were loose but tightened'),
(16, '090066D', 'The Guy Wire Tensions are not to specification'),
(17, '090066D', '?Eye ? Jaw? type turnbuckles have been installed'),
(18, '090066D', 'Guy Wire Ends not fitted with Crimp Caps. Use has been made of Plastic Tape and GI Wire'),
(19, '090066D', 'The OBL is NOT working'),
(20, '090066D', 'Some White Cable Ties have been used to secure Feeders'),
(21, '090066D', 'Site is not clean. Contractors material not cleaned up e.g Bricks, Steel Pipe etc. A lot of Landlord materials also stored on roof e.g Bamboo'),
(22, '090066D', 'Some of Pole Climbing Steps are slightly bent'),
(23, '090066D', 'Microwave Coaxial Feeder Cables fixed to Climbing Step. This is a safety hazard and climber has to climb carefully and unnaturally due to limited space on step'),
(24, '090066D', '2G Cable Ladder is NOT properly fixed to roof'),
(25, '090066D', 'Wooden Access Step is broken and dangerous'),
(26, '090066D', 'GI Climbing Ladder to rooftop, top section is not fixed to the wall'),
(27, '090066D', '3G Cable Ladder, joints are not bonded with a Cable Strap'),
(28, '090066D', 'As-Build Drawing is wrong'),
(29, '090066D', 'TI work is messy and Grounding Kits are not positioned correctly, due to length of Cable being too short to reach Grounding Bar'),
(30, '090066D', 'Community requested money to access rooftop ? Politely ignored and Masjid Donation offered but declined');
